import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import {  Button, NavLink } from 'reactstrap';
import classnames from 'classnames';
import Messages from "./Messages";
import MultiTabs, { MultiTabContext } from "./components/MultiTabs";


const Tab = ({ count }) => (
    <MultiTabContext.Consumer>
      {({ activeTabId, currentTabCount, addTab, close }) => {
        return (
          <div className="border-right border-left border-bottom p-3">
            <h2>Tab {count}</h2>
            <Button
              onClick={() => {
                const nextTab = currentTabCount + 1;

                addTab(`Tab ${nextTab}`, <Tab count={nextTab} />);
              }}
            >
              Add new tab
            </Button>
          </div>
        );
      }}
    </MultiTabContext.Consumer>
  );

class Pages extends Component {

  render() {

    return (
      <MultiTabs openTabImmediately defaultActiveTab={1}>
          <MultiTabs.Tab title={({ close, activeTabId, tabId }) => <NavLink onClick={() => console.log(`Selected tab: ${tabId}`)} className={classnames(
                  { active: activeTabId === tabId }
                )}>
                <div className="d-flex align-content-center flex-wrap">
                  <div className="m-1"> Tab 1</div>
                  <div className="p-0">
                    <Button size="sm" color="link" onClick={event => {
                        event.stopPropagation();
                        console.log("Custom close clicked");
                        close(tabId);
                      }}>
                      X
                    </Button>
                  </div>
                </div>
              </NavLink>}>
            <Tab count={1} />
          </MultiTabs.Tab>

        </MultiTabs>
    );
  }


}

export default Pages;
